    return <div>
        <h2 className="homeTitle">New here?</h2>
        <h3 className="homeTitle">Head over to users for login credentials</h3>
        <div className="home">
            <RecentArticles users={this.props.users}/>
            <Trending users={this.props.users}/>
        </div>
      </div>;
};

export default Home;
